        INSITE.parseBooleanArgument = function(arg, def){
            return (arg != null) ? (arg == true || arg == 'true' || arg == 'on') : def;
        };

        INSITE.querystringToObj = function(str)  {
          var pairs = str.split("&");
          var obj = {};
          if (pairs && pairs.length > 0)  {
            for (i = 0; i < pairs.length; i++) {
               var vals = pairs[i].split("=");
               if (vals && vals.length == 2)  {
                 obj[vals[0]] = vals[1];
               }
            }
          }
          return obj;
        };

        INSITE.postMessage = function(type, id, object){
            insiteJQuery(INSITE.messageSubscribers).each(function(index){
                this(type,id, object);
            });
        };

        INSITE.registerForMessages = function(callback){
            INSITE.messageSubscribers.push(callback);
        };


        INSITE.shortenString = function(str, length){
            if(str){
                str = insiteJQuery.trim(str);
                if(str.length>length){
                    str=str.substring(0, length) + "...";
                }
                return str;
            } else{
                return "";
            }
        }

