        INSITE.Presence = function (options) {
            var my = this;
            INSITE.globalWidgets.presence=this;

            if(options == null){
                options={};
            }

            if(options.presenceClassPrefix == null){
                options.presenceClassPrefix= "presence-";
            }
            if(options.presenceRefreshClass == null){
                options.presenceRefreshClass = 'presenceable';
            }
            if(options.refreshRate == null){
                options.refreshRate= 61000;
            }
            if(options.batchRequestSize == null){
                options.batchRequestSize=5;
            } else{
                // be able to handle a string
                var batchNum = Number(options.batchRequestSize);
                if(batchNum && batchNum != 'NaN') {
                    options.batchRequestSize=batchNum;
                } else{

                }
                options.batchRequestSize=batchNum;
            }
            if(options.batchAll == null){
                options.batchAll=-1;
            }

            my.options=options;


            my.parseBemsIdFromElement = function(element){
                var elementClassNames = element.className.split(' ');
                var bemsid;
                for(var i=0;i<elementClassNames.length;i++) {
                    if(elementClassNames[i].indexOf(my.options.presenceClassPrefix ) === 0) {
                        bemsid = elementClassNames[i].substring(
                            elementClassNames[i].indexOf(my.options.presenceClassPrefix ) + my.options.presenceClassPrefix.length,
                            elementClassNames[i].length);
                        var bemsNum = Number(bemsid);
                        //verify it's a bemsid as other styles could begin with the same prefix
                        if(bemsNum && bemsNum != 'NaN') {
                            break;
                        }
                    }
                }
                return bemsid;
            };

            my.notify = function(o){
                my.refresh();
            }

            my.refresh = function(refreshClass){
                if(refreshClass == null){
                    refreshClass = my.options.presenceRefreshClass;
                }

                var presenceElements=insiteJQuery('span.'+refreshClass);

                var elementId;
                var request;

                // sucks javascript has no hashtable.
                var bemsToPresenceElements = {};


                if(presenceElements) {
                    for(var i=0;i<presenceElements.length;i++) {
                        insiteJQuery(presenceElements[i]).attr('id',INSITE.guidGenerator());

                        var presenceElement = insiteJQuery(presenceElements[i]);

                        var statusImg = presenceElement.children('[class*=status-image-]')[0];
                        var bemsId = my.parseBemsIdFromElement(presenceElements[i]);
                        if(!statusImg) {
                            var elem = "<a alt=\"unknown is unknown \" title=\"unknown is unkown\""+
                                "  href=\"\">"+
                                " <img class=\"status-image-"+bemsId+"\ insite-widget\" alt=\"unknown is unkown\""+
                                "  title=\"unknown is unkown\" src=\""+my.getImagePath("images/presence/UNKNOWN.gif")+"\"/>"+
                                "</a>";

                            presenceElement.html(elem);
                            if(!presenceElement.is(":visible")) {
                                presenceElement.fadeIn('fast');
                            }
                        }

                        elementId = presenceElement.attr('id');


                        if(bemsId) {
                            var elementsForBems = bemsToPresenceElements[bemsId];
                            if(!elementsForBems) {
                                //create a new array to store all of the presence ids related to a specific user
                                elementsForBems = new Array();
                            }

                            //add this presence element to the list that map to the user's bems
                            elementsForBems[elementsForBems.length] = elementId;

                            //map each bems to a list of the presence elements that represents it
                            bemsToPresenceElements[bemsId]= elementsForBems;
                        }

                        //send the request if we hit the batch limit or the end of the array
                        if((i > 0 && my.options.batchRequestSize != my.options.batchAll && (INSITE.hashSize(bemsToPresenceElements) % my.options.batchRequestSize == 0))
                                || i == (presenceElements.length - 1)) {
                            request = my.queryPresence(bemsToPresenceElements, false);
                            bemsToPresenceElements = new Array(); //intialize the hash for the next batch
                        }

                    }
                }
            };

            my.queryPresence = function(bemsToPresenceElements, checkIfVisible) {

                var bemsIds = '';

                var queryBemsElement = !checkIfVisible;

                for (key in bemsToPresenceElements) {
                    queryBemsElement = !checkIfVisible; //reset based on indication to check


                    // using named values on a {} but since prototype, and others add a bunch of crap to the object we
                    // gotta filter them out. Maybe we could add a HashMap implementation, but would want to do it in such a way that it is not added to
                    // the global namespace.
                    if(isNaN(key)){
                        continue;
                    }

                    if(checkIfVisible) { //search through all elements related to this bems to see if any are visible
                        var elementsForBems = bemsToPresenceElements[key];
                        if(elementsForBems) {
                            for(var j=0;j<elementsForBems.length;j++) {
                                var elem =   insiteJQuery('#'+elementsForBems[j]);
                                if(elementsForBems[j] && elem && elem.is(":visible")) {
                                    queryBemsElement = true;
                                    break;
                                }
                            }
                        }
                    }

                    //add the bemsid to list if any of the elements related to this bemsid are visible
                    if(queryBemsElement) {
                        if(bemsIds.length > 0 ) {
                            bemsIds += ",";
                        }
                        bemsIds += key;
                    }
                }

                var request = null;

                if(bemsIds && bemsIds.length > 0) {

                    var url = 'service/presence/' + bemsIds;


                        if (INSITE.isInsite()==false){
                            url=INSITE.widgetBaseURL+'/'+url+'?callback=?';
                        }


                    insiteJQuery.getJSON(url, function(people){
                        if(people != null) {
                                var securePage, bemsId;
                                //update page for each person in the result
                                for(var i=0;i<people.length;i++) {
                                    my.updatePresenceOnPage(people[i], bemsToPresenceElements[people[i].bemsId], securePage);
                                }
                            }
                            setTimeout(function(){my.queryPresence(bemsToPresenceElements, true)},my.options.refreshRate);
                    });

                } else if(INSITE.hashSize(bemsToPresenceElements) > 0) { //if presence elements were supplied, but we're not querying for any right now, reschedule the query attempt
                    //reschedule to check again, some of the elements may reappear by then
                    setTimeout(function(){my.queryPresence(bemsToPresenceElements, true)},my.options.refreshRate);
                }

                return request;
            };

            my.getImagePath = function(imgPath){
                securePage = window.location.pathname.indexOf("/secure/") != -1;
                if(securePage) {
                    imgPath = "../" + imgPath;
                }

                if (!INSITE.isInsite()){
                    imgPath = INSITE.widgetBaseURL + '/' + imgPath;
                }
                return imgPath;
            };

            my.updatePresenceOnPage = function(person, elementsForBems, securePage) {

                var imgPath = my.getImagePath(person.statusIcon);


                var presenceElement = null;

                //run through and update the status for all presence elements that represent this person
                for(var i=0;i<elementsForBems.length;i++) {
                    presenceElement = insiteJQuery('#'+elementsForBems[i]);
                    var link = insiteJQuery(presenceElement.children('a')[0]);
                    var statusImg = insiteJQuery(link.children('img')[0]);

                    var status = person.name + ' is ' + person.status;

                    link.attr('href', "sip:"+person.email);
                    link.attr('alt', status);
                    link.attr('title', status);

                    statusImg.attr('src', imgPath);
                    statusImg.attr('alt', status);
                    statusImg.attr('title', status);
                }

            };


            insiteJQuery(window).ready(function(){my.refresh();});
            return my;
        }

        INSITE.MaxLengthManager = function(options) {
           var my = this;
            options.maxLength = options.maxLength ? options.maxLength : 1024;
            options.defaultText = options.defaultText ? options.defaultText : "";
            options.warningColor = options.warningColor ? options.warningColor : "red";
            options.allowOverType = INSITE.parseBooleanArgument(options.allowOverType, true);
            my.options = options;

            my.init = function() {
                insiteJQuery(options.textInputSelector).on("keyup", my.enforce);
                var pasteEvent = navigator.userAgent.indexOf('Trident') > -1 ? 'propertychange' : 'input';
                insiteJQuery(options.textInputSelector).on(pasteEvent, my.enforce);
            }

            my.enforce = function(event) {
               var textEl = insiteJQuery(my.options.textInputSelector);
               var remaining = my.options.maxLength - textEl.val().length;
               if (my.options.warningLength && remaining <= my.options.warningLength) {
                  insiteJQuery(my.options.remainingCharSelector).css('color', my.options.warningColor);
                  if (my.options.warnExceededCallback) {
                      my.options.warnExceededCallback(true);
                  }
               }
               else {
                   insiteJQuery(my.options.remainingCharSelector).css('color', '');
                   if (my.options.warnExceededCallback) {
                       my.options.warnExceededCallback(false);
                   }
               }
               insiteJQuery(my.options.remainingCharSelector).html(remaining);

               var elToDisable = insiteJQuery(my.options.elementToDisableSelector);
               if (my.options.elementToDisableSelector && elToDisable.length > 0) {
                  if (remaining < 0 || remaining == my.options.maxLength || textEl.val().trim() == "" || (my.options.defaultText && my.options.defaultText == textEl.val())) {
                     elToDisable.addClass('disabled').addClass('length-enforced').attr('disabled', 'disabled');
                  }
                  else {
                     elToDisable.removeClass('disabled').removeClass('length-enforced').removeAttr('disabled');
                  }
               }
                if (event && !my.options.allowOverType && textEl.val().length > my.options.maxLength && event.keyCode != 8 && event.keyCode != 46) {
                  textEl.val(textEl.val().substring(0, my.options.maxLength)); 
                  textEl.focus();
                  return false;
                }
              return true;
            }
            
            my.destroy = function() {
                insiteJQuery(options.textInputSelector).unbind("keyup").unbind("propertychange").unbind("input");
            }
        };


